import React from "react";

const About = () => {
    const [channelStats, setChannelStats] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get(
          `https://www.googleapis.com/youtube/v3/channels?part=statistics&id=UCQPd8gpbFIELdNHIAAWfb4w&key=AIzaSyBfiFJgC7ajUd9u8XcffJIJsSxQp65LQP4`
        );
        setChannelStats(response.data.items[0].statistics);
      } catch (error) {
        console.error('Error fetching channel statistics:', error);
      }
    };

    fetchData();
  }, []);
    return (
        <>
            <h1>Hello</h1>
            UCQPd8gpbFIELdNHIAAWfb4w
            AIzaSyBfiFJgC7ajUd9u8XcffJIJsSxQp65LQP4
        </>
    );
}

export default About;
